import React, { Component } from 'react';
class NewChild extends Component {
    constructor() {
        super();
        this.state = {
          number: 0,
        };
      }
    
      clickHandler = () => {
        this.setState(prevState=>({
          number:prevState.number + 1,
        }));
      };

    render() {
        return (
            <div>
                <button onClick={this.clickHandler}>Cycles + 1</button>
                <h3>Number o</h3>
            </div>
        );
    }
}

export default NewChild;
